import React from 'react';
import { Link, useNavigate } from 'react-router-dom';
import '../styles/Navbar.css'; // Import the CSS file for styling

const Navbar = ({ logged, logOut }) => {
    const navigate = useNavigate();

    const handleLogout = () => {
        logOut(navigate); // קורא לפונקציה logOut ומעביר את navigate
    };

    return (
        <nav className="navbar">
            <ul className="nav-links">
                <li><Link to="/">Home</Link></li>
                <li><Link to="/about-us">About Us</Link></li>
                <li><Link to="/packages">Pricing</Link></li>
                {logged ? (
                    <div>
                        <li><Link className={"sign-button"} to="/" onClick={handleLogout}>LogOut</Link></li>
                        <li><Link to="/profile">Profile</Link></li>
                    </div>
                ) : (
                    <li><Link className={"sign-button"} to="/login">Sign In</Link></li>
                )}
            </ul>
        </nav>
    );
};

export default Navbar;
